text384575.addInnerText('<div id=\"text384575\" aria-live=\"polite\" ><a id=\"text384575anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384575Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384575CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384575Font2\"  >Definition:</span ><span class=\"text384575Font3\"  > Compromise of official information </span ><span class=\"text384575Font2\"  >not expected to cause any damage </span ><span class=\"text384575Font3\"  >to the National interest, organisations or individuals. Attracts a </span ><span class=\"text384575Font2\"  >Low</span ><span class=\"text384575Font3\"  > Business Impact Level. \n</span ></li >\n</ul >\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384575Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384575Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384575CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384575Font3\"  >OFFICIAL is the baseline category of official information. It is used where knowledge of information can be shared across the organisation (ie there are no restrictions on dissemination). OFFICIAL is used for the majority of Defence\'s business.&nbsp; \n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384575Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384575Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384575CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384575Font2\"  >Examples of use:&nbsp;\n</span ></li >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384575Font3\" data-bltIndnt=\"110\" style=\"line-height:1.229;position:relative;margin-left:126px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384575CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:110\n} --><span class=\"text384575Font3\"  >FAQs, guides, websites, training materials and other general information\n</span ></li >\n<li  class=\"text384575Font4\" data-bltIndnt=\"110\" style=\"line-height:1.229;position:relative;margin-left:125px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384575CircleBulletFont9.png\'); padding-left:8px;\"><!--{ \ndata-bltIndnt:110\n} --><span class=\"text384575Font3\"  >General office-related information such as meetings, emails and conversations </span ><span class=\"text384575Font4\" style=\"background-color:transparent\" >\n</span ></li >\n</ul >\n<p  legLH=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384575Font4\" style=\"background-color:transparent\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384575Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384575CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384575Font2\"  >Requirements to access:</span ><span class=\"text384575Font3\"  > No security clearance required, however the need-to-know principle does still apply.&nbsp; \n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384575Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384575Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384575CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384575Font2\"  >Handling Requirements: </span ><span class=\"text384575Font3\"  >See Module 2 and the Guide for more information. \n</span ></li >\n</ul >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
text384575.build()

text384589.addInnerText('<div id=\"text384589\" aria-live=\"polite\" ><a id=\"text384589anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384589Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384589Font2\"  >Definition:</span ><span class=\"text384589Font3\"  > Compromise of official information expected to cause </span ><span class=\"text384589Font2\"  >limited damage</span ><span class=\"text384589Font3\"  > to National interest, organisations or individuals. Attracts a </span ><span class=\"text384589Font2\"  >Low/Medium</span ><span class=\"text384589Font3\"  > Business Impact Level. \n</span ></li >\n</ul >\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384589Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384589Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384589Font3\"  >OFFICIAL:&nbsp;Sensitive is not a \'security classification\' and is only to be applied to unclassified information where dissemination of that information is limited to those with a need-to-know.\n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384589Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384589Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384589Font2\"  >Examples of use:\n</span ></li >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384589Font3\" data-bltIndnt=\"110\" style=\"line-height:1.229;position:relative;margin-left:126px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:110\n} --><span class=\"text384589Font3\"  >Procurement related information for projects\n</span ></li >\n<li  class=\"text384589Font3\" data-bltIndnt=\"110\" style=\"line-height:1.229;position:relative;margin-left:126px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:110\n} --><span class=\"text384589Font3\"  >Information that may contain personal or legal details\n</span ></li >\n<li  class=\"text384589Font3\" data-bltIndnt=\"110\" style=\"line-height:1.229;position:relative;margin-left:126px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:110\n} --><span class=\"text384589Font3\"  >Standard Operating Procedures, Standing Orders, and other local regulations for the operation of a unit or business </span ><span class=\"text384589Font4\" style=\"background-color:transparent\" >\n</span ></li >\n</ul >\n<p  legLH=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384589Font4\" style=\"background-color:transparent\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384589Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384589Font2\"  >Requirements to access:</span ><span class=\"text384589Font3\"  > Must have a Need-to-Know. No security clearance is required.&nbsp; \n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384589Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384589Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384589CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384589Font2\"  >Handling Requirements: </span ><span class=\"text384589Font3\"  >See Module 2 and the Guide for more information.\n</span ></li >\n</ul >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
text384589.build()

text384599.addInnerText('<div id=\"text384599\" aria-live=\"polite\" ><a id=\"text384599anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384599Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384599CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384599Font2\"  >Definition:</span ><span class=\"text384599Font3\"  > Compromise of official information expected to cause </span ><span class=\"text384599Font2\"  >damage</span ><span class=\"text384599Font3\"  > to National interest, organisations or individuals. Attracts a </span ><span class=\"text384599Font2\"  >High</span ><span class=\"text384599Font3\"  > Business Impact Level. &nbsp;\n</span ></li >\n</ul >\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384599Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384599Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384599CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384599Font3\"  >PROTECTED is the lowest \'security classification\' &nbsp;to be applied to official information that requires higher than standard protections. \n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384599Font3\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384599Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384599CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384599Font2\"  >Examples of use:&nbsp;\n</span ></li >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384599Font3\" data-bltIndnt=\"110\" style=\"line-height:1.229;position:relative;margin-left:126px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384599CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:110\n} --><span class=\"text384599Font3\"  >A Movement Security Plan for the domestic transport of weapons or explosive ordinance\n</span ></li >\n<li  class=\"text384599Font3\" data-bltIndnt=\"110\" style=\"line-height:1.229;position:relative;margin-left:126px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384599CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:110\n} --><span class=\"text384599Font3\"  >Threat reports to support risk assessments for key events - such as Open Days, ANZAC Day processions, and movements of VIPs </span ><span class=\"text384599Font4\" style=\"background-color:transparent\" >\n</span ></li >\n</ul >\n<p  legLH=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384599Font4\" style=\"background-color:transparent\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text384599Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384599CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384599Font2\"  >Handling Requirements: </span ><span class=\"text384599Font3\"  >See Module 2 and the Guide for more information.\n</span ></li >\n</ul >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
text384599.build()
